import React, { Component } from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Login5 from './components/Login5';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import SignUp5 from './components/SignUp5';


class Report extends Component {
    render() {
        return (
            <Router>
            <div className="App">
              <nav className="navbar navbar-expand-lg navbar-light fixed-top">
                <div className="container">
                  <Link className="navbar-brand" to={"/sign-in"}>Medical Report Status</Link>
                  <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
                    <ul className="navbar-nav ml-auto">
                      <li className="nav-item">
                        <Link className="nav-link" to={"/sign-in"}>Lipid profile</Link>
                      </li>
                      <li className="nav-item">
                        <Link className="nav-link" to={"/sign-up"}>Blood Sugar</Link>
                      </li>
                    </ul>
                  </div>
                </div>
              </nav>
        
              <div className="auth-wrapper">
                <div className="auth-inner">
                  <Switch>
                    <Route exact path='/' component={Login5} />
                    <Route path="/sign-in" component={Login5} />
                    <Route path="/sign-up" component={SignUp5} />
                  </Switch>
                </div>
              </div>
            </div></Router>
        );
    }
}

export default Report;
